import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: 1,
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021 ,2, 28)
    },
    {
      id: 2,
      title: "Car Payment",
      amount: 228.00,
      date: new Date(2021 ,2, 28)
    },    {
      id: 3,
      title: "Gas",
      amount: 41.75,
      date: new Date(2021 ,2, 28)
    },    {
      id: 4,
      title: "Car Washes",
      amount: 24.99,
      date: new Date(2021 ,2, 28)
    },
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expenses[0].title}
        amount={expenses[0].amount}
      ></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>

    </div>
  );
}

export default App;
